/* nya.sh -- Dark Theme
** Version: 0.1
*/

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("nya.sh") {

body{
color: #606060 !important;
background: #000000 top center repeat !important;
/*border: 3px solid #000000 !important;*/
background-image:    /* url("http://dl.getdropbox.com/u/1140263/Stylish/Userstyles/55c14d4c6544191b4ca8cbce6e2ac4b867875648654uigkugfj65487654756fi7yr.png") */
url(data:image/png;base64,) !important;
}

#inner-body{
color: #A0A0A0 !important;
background: #111111 !important;
}

#menu{
background-color: #000000 !important;
margin: 0px !important;
border-bottom: 1px solid #000000 !important;
border-top: 1px solid #000000 !important;
padding: 4px !important;
}

div.q { border: 1px #000 solid !important; }

#body{
background-color: #000000 !important;
border: 1px #000000 !important;
width: 760px !important;
}

.sh{ width: 770px !important; }
.sh_t, .sh_t div, .sh_b, .sh_b div, .sh_l, .sh_r{
background: #000000 !important;
}
.sh_t div, .sh_b div{
width: 0px !important;
height: 4px !important;
left: -0px !important;
}
.sh_t, .sh_b{
margin: 0 0 0 0px !important;
height: 4px !important;
}
.sh_l,.sh_l_{ padding: 0 0 0 0 !important; }
.sh_r,.sh_r_{ padding: 0 0 0 0 !important; }

a{
color: #40F000 !important;
text-decoration: none !important;
border-bottom: 1px #00A000 dashed !important;
}
a:hover{
color: #ffa200 !important;
text-decoration: none !important;
/*border-top: 1px #A05200 dashed !important;*/
border-bottom: 1px #A05200 dashed !important;
}
a:visited{
color: #008000 !important;
text-decoration: none !important;
border-bottom: 1px #004000 dotted !important;
}
a:visited:hover{
color: #F04000 !important;
border-bottom: 1px #A00000 dotted !important;
}


.toplink{
display: none !important;
}

img[src*="/top/top"], img[src*="/imgs/bottom-"]{ display: none !important; }
#hdr{
height: 170px;
background: #111111 no-repeat !important;
border: 0px !important;
background-image: url(data:image/gif;base64,
) !important;
}

}
